/**
 * 去重
 */
export function unique<T, K extends keyof T>(arr: T[], key: K) {
  let map = new Map()
  arr.forEach((item, index) => {
    if (!map.has(item[key])) {
      map.set(item[key], item)
    }
  })
  return [...map.values()]
}
